import React from "react";
import cl from "./Home.module.css";

const Home = () => {
  return (
    <div class={cl.HomeMainContainer}>
      <section className={cl.EcommerceContainer}>
        <h1>Электронная коммерция</h1>
      </section>
      <section className={cl.FormContainer}>
      <div className={`container-fluid ${cl.contactFormContainer}`}>
        <div className="row">
          <div className="col-12">
            <h2 className={cl.callbackFormTitle}>
              Остались вопросы? Свяжитесь с нами!
            </h2>
            <div className={cl.formCase}>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>{t("Contacts.form_name")}</label>
                <input
                  type="text"
                  name="name"
                  id="full-name"
                  placeholder={t("Contacts.form_name")}
                  value={name}
                  onChange={(e) => {
                    setName(e.target.value);
                  }}
                />
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>Email</label>
                <input
                  type="email"
                  name="_replyto"
                  id="email-address"
                  placeholder="Email"
                  value={email}
                  onChange={(e) => {
                    setEmail(e.target.value);
                  }}
                />
                {emailError ? (
                  <label className={cl.errorEmail}>
                    {t("PriceAuth.errorEmail")}
                  </label>
                ) : null}
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>{t("Contacts.form_phone")}</label>
                <InputMask
                  mask="+9 (999) 999-99-99"
                  placeholder="+7 (000) 000-00-00"
                  maskChar={null}
                  value={phone}
                  onChange={(e) => setPhone(e.target.value)}
                />
              </div>
              <div className={cl.formInput} style={{ marginBottom: 20 }}>
                <label>{t("Contacts.form_message")}</label>
                <textarea
                  type="text"
                  name="message"
                  id="message"
                  className={cl.textarea}
                  placeholder={t("Contacts.form_message")}
                  value={message}
                  onChange={(e) => {
                    setMessage(e.target.value);
                  }}
                ></textarea>
              </div>

              <button
                type="submit"
                className={cl.formButton}
                onClick={() => sendMessage()}
              >
                {t("Contacts.form_send")}
              </button>
            </div>
          </div>
        </div>
      </div>
      </section>
    </div>
  );
};

export default Home;
